import { Outlet } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";
import cssClasses from './root.module.css';

export default function Root({ children }) {
  return (
    <>
      <MainNavigation/>
      <Outlet>{children}</Outlet>
    </>
  );
}
